- input: "TEXT\x1CC00089243\x1C.TEXT\x1C\x1CF3XA\x1CTransfers of excess campaign funds
    have been clarified.  Payments from organizations for the Massachusetts Democratic
    Party voter file are for the usual and normal charge based on market research
    and enhancements made to the file.  Disbursements for automated calling and polling
    were incorrectly reported in the original report and have been correctly classified
    on line 30(b) of this amendment.  Voter file maintenance remains a split cost
    as it is a quarterly expense not tied to a federal election.  The committee continues
    to employ best efforts to provide employers and occupations.  Additional information
    received has been disclosed in this report."
